import React from "react";
import Comments from "./Comments";
function Postcard (){

    return(
        <div class="card pic">
            <div class="card-image">
                <img src="https://pbs.twimg.com/media/Ez5yIwsVUAcW-U0.jpg:large"/> 
            </div>
            
            <div class="card-content" style={{textAlign:"left"}}>
                <span class="card-title" style={{color:"#2568FB"}}>Card Title</span>
                <p>I am a very simple card. I am good at containing small bits of information.
                    I am convenient because I require little markup to use effectively.
                </p>
                
            </div>
            <div style={{display:"flex",flexDirection:"row"}}>
                <i class="small material-icons">favorite_border
                <p>253</p>
                </i>
            </div>
            <div class="card-action">
                <Comments />
            </div>
        </div>    
    );
}

export default Postcard;
